import logo from './logo.svg';
import React from 'react';
import './App.css';

function App() {

  const [employeeList, setEmployeeList] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((employeeList) => setEmployeeList(employeeList));
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>{!employeeList ? "Loading..." : employeeList}</p>
      </header>
    </div>
  );
}

export default App;
